import React from "react";

import Header from "../Header";
import HeaderMobile from "../HeaderMobile";

const MainWrapper = props => {
	return (
		<div className="flex jc-end">
			<HeaderMobile />
			<Header />
			{props.children}
		</div>
	);
};

export default MainWrapper;
